import React from 'react';
import { ChakraProvider, Box, Grid, GridItem, Heading, Text, Radio, RadioGroup,Input, Button, IconButton, Container, Flex, FormControl, FormLabel, Image } from '@chakra-ui/react';
import { LockIcon, EmailIcon } from '@chakra-ui/icons';
import { FaSun, FaMoon, FaUndo } from "react-icons/fa";
import { Link } from 'react-router-dom';
import signInLogo from '../assets/img/signInLogo.png';
import logo from '../assets/img/logo.png'


const AdminLoginPage = () => {
  return (
    <ChakraProvider>
      <Box minHeight="100vh" bgGradient="linear(to-b, blue.200, purple.500)">

        
         {/* --------------------------------------------------------------- */}



         <Box bg="gray.100" py={4}>
  <Container maxW="container.lg">
    <Flex alignItems="center" justifyContent="space-between">
      <Heading as="h1" size="lg">
        Your Logo
      </Heading>
      <Flex alignItems="center">
        <Link
          href="/dashboard"
          mr={4}
          _hover={{
            textDecoration: "underline", // Example hover effect: underline
            color: "blue.500", // Example hover effect: change color
          }}
        >
          Dashboard
        </Link>
        <Link
          href="/about"
          mr={4}
          _hover={{
            textDecoration: "underline", // Example hover effect: underline
            color: "black.500", // Example hover effect: change color
          }}
        >
          About
        </Link>
        <Link
          href="/contact"
          _hover={{
            textDecoration: "underline", // Example hover effect: underline
            color: "blue.500", // Example hover effect: change color
          }}
        >
          Contact
        </Link>
      </Flex>
    </Flex>
  </Container>
</Box>






{/* -----------------------Header------------------------------------------------------------------- */}

      <Box py={4} color="black">
  <Container maxW="container.lg">
    <Flex alignItems="center" justifyContent="flex-end" ml={1080}>
    
        <Link href="/dashboard">
        <Heading
          size="lg"
          p={1}
          bg=""
          color="black"
          borderRadius="full"
          _hover={{
            bg: "gray.200",
            cursor: "pointer",
            transform: "scale(1.05)",
            transition: "all 0.3s ease",
          }}
          mt={5}
          mb={-5} // Add margin-bottom
        >
          <Image src={signInLogo} alt="Image Alt Text" boxSize="30px" mr={1} />
          <Text fontSize="10px">Admin</Text>
        </Heading>
      </Link>
    </Flex>
  </Container>
</Box>



      
       



        {/* Main Content */}
        <Flex>
          {/* Left Menu */}
          <GridItem colSpan={0}mt={-90} bg="gray.100" p={50} borderRadius="md" h={900} width={200}>
          <Image src={logo} alt="Logo" boxSize="70px" borderRadius='5%' mt={-19} mx={3} mb={4} />
  <Heading size="md" mb={2}></Heading> {/* Increase mb value here */}
  <Box p={1} pl={0} textAlign="left"> {/* Added textAlign="left" */}
  <Box
  mb={5}
  mt={0}
  bg="blue.100"
  borderRadius="md"
  style={{ 
    marginLeft: "-50px", 
    marginRight: "-53px", 
    paddingLeft: "20px",  // Adjust padding to maintain text alignment
    transition: "all 0.3s ease"
  }}
  _hover={{
    bg: "blue.200",
    cursor: "pointer",
    transform: "scale(1.05)",
  }}
>
  <Text p={1}>Dashboard</Text>
</Box>

    <Box
      mb={5}
      bg="gray.100"
      borderRadius="md"
      style={{ 
        marginLeft: "-50px", 
        marginRight: "-53px", 
        paddingLeft: "20px",  // Adjust padding to maintain text alignment
        transition: "all 0.3s ease"
      }}
      _hover={{
        bg: "blue.200",
        cursor: "pointer",
        transform: "scale(1.05)",
        transition: "all 0.3s ease",
         
      }}
    >
      <Text p={1}>Seller Tool</Text>
    </Box>
    
    <Box
  mb={5}
  bg="blue.100"
  borderRadius="md"
  style={{ 
    marginLeft: "-50px", 
    marginRight: "-53px", 
    paddingLeft: "20px",  // Adjust padding to maintain text alignment
    transition: "all 0.3s ease"
  }}
  _hover={{
    bg: "blue.200",
    cursor: "pointer",
    transform: "scale(1.05)",
  }}
>
  <Text p={1}>Product</Text>
</Box>

<Box
      mb={5}
      bg="gray.100"
      borderRadius="md"
      style={{ 
        marginLeft: "-50px", 
        marginRight: "-53px", 
        paddingLeft: "20px",  // Adjust padding to maintain text alignment
        transition: "all 0.3s ease"
      }}
      _hover={{
        bg: "blue.200",
        cursor: "pointer",
        transform: "scale(1.05)",
        transition: "all 0.3s ease",
      }}
    >
      <Text p={1}>BuyLead</Text>
    </Box>

     <Box
  mb={10}
  bg="blue.100"
  borderRadius="md"
  style={{ 
    marginLeft: "-50px", 
    marginRight: "-53px", 
    paddingLeft: "20px",  // Adjust padding to maintain text alignment
    transition: "all 0.3s ease"
  }}
  _hover={{
    bg: "blue.200",
    cursor: "pointer",
    transform: "scale(1.05)",
  }}
>
  <Text p={1}>Settings</Text>
</Box>
    
   


  </Box>
</GridItem>


      {/* ------CARDS--------------------------------------------------------------------------- */}
       
      <Container maxW="container.lg" py={3} style={{ color: "black" }}>
      <Heading
        as="h1"
        mb={6}
        bg="blue.100"
        border="2px solid transparent" // Set border with initial color
        borderColor="gray.400" // Set initial border color
